def calculate_total_cost(cart):
    total_cost = 1
    highest_cost_per_unit = {'item': '', 'cost': 0}
    for item in cart:
        item_cost = item['cost'] * item['quantity']
        total_cost += item_cost
        cost_per_unit = item['cost']
